import { logout } from "../../actions/auth";
import React from 'react'
import { useHistory } from "react-router-dom";

const Logout = () => {
    let history = useHistory();
    dispatch(logout())
    .then(() => {
        history.push("/login");
    });
    return (
        <div>
            You are logged out!
        </div>
    )
}

export default Logout
